import React , { Component } from 'react';

const MovieListItem = (props) => {

    const movies = props.movies.map(movie => {
        return (
          <div>
            <h3>{movie.id} {movie.title}</h3>
          </div> 
      )
    });

    return(
        <div>
            {movies}
        </div>
    );
}

export default MovieListItem;
